## Input: A DNA string Genome.
## Output: All integer(s) i minimizing Skewi (Genome) among all values of i (from 0 to |Genome|).

import math
GENOME = ""

skew_idx = 0 
skew_indices =  [skew_idx]
skew_dict = {}

for i, ch in enumerate(GENOME):
    current_location = i + 1

    if ch == 'C':
        skew_idx = skew_idx - 1
    elif ch == 'G':
        skew_idx = skew_idx + 1

    if skew_dict.get(skew_idx):
        skew_dict[skew_idx].append(current_location)
    elif skew_dict.get(skew_idx) == None:
        skew_dict[skew_idx] = [current_location]

min_value = math.inf
for key in skew_dict.keys():
    if key < min_value:
        min_value = key

print(skew_dict[min_value])